                </a>
            </li>
            <li className="my-2 border-2 border-black md:my-0 " style={activeComponent === 'UserPage' ? activeDisplay : null}>
                <a onClick={(e) => props.handleClick(e)} id='UserPage' className="block py-1 pl-1 text-gray-600 no-underline align-middle md:py-3 hover:text-indigo-400">
