                </a>
            </li>
            <li className="my-2 border-2 border-black md:my-0" style={activeComponent === 'CategoryPage' ? activeDisplay : null}>
                <a onClick={(e) => props.handleClick(e)} id='CategoryPage' className="block py-1 pl-1 text-gray-600 no-underline align-middle md:py-3 hover:text-indigo-400">
                    <i className="mr-3 fa fa-wallet fa-fw"></i><span className="inline-block w-full pb-1 text-sm md:pb-0">Payments</span>
                </a>
            </li>
        </ul>
